    false,nt"url": null,nt"notes": "This annual narrative report for Montezuma
    National Wildlife Refuge outlines Refuge accomplishments during the 1965 calendar
    year. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover conditions during the year. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
    raptors, fish, and reptiles- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, and vegetation control. Resource
    management is outlined; topics include grazing, fur harvesting, and timber removal.
    A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes recreational uses, hunting,
    violations, and safety. Items of interest, N-R forms, and photographs are attached.",nt"owner_org":
